var redux=require('redux');
defaultState={
    listUsertoUser:[],
}
var usertouserReducer = (state = defaultState,action)=>{
    switch (action.type){
        case 'LOAD_LIST_USERTOUSER':
            return {...state, listUsertoUser:[...state.listUsertoUser,action.item]}
    }
    return state;
}

export default usertouserReducer
